Teaser:
เรียกใช้โปรแกรม C/C++ ของคุณใน ChATGPT โดยใช้พรอมต์นี้ นี่เป็นคำสั่งที่มีประสิทธิภาพมากในการเรียกใช้ภาษาการเข้ารหัสทุกประเภทโดยตรงในเว็บเบราว์เซอร์ของคุณโดยใช้ Chatgpt

 เพียงพิมพ์โค้ด C หรือ C++ ที่คุณต้องการเรียกใช้ในพรอมต์ จากนั้น Chat-GPT จะให้ผลลัพธ์ของโปรแกรมนั้นตอบสนอง

 สิ่งนี้มีประโยชน์หากคุณไม่ได้ติดตั้งคอมไพเลอร์ในพีซีของคุณ และต้องการทดสอบโค้ดบางอย่างในตอนนี้ คุณสามารถทำได้โดยง่าย ๆ

 ตัวอย่างโค้ด C++
 #รวม <ไอสตรีม>

 int หลัก () {
  std::cout << "สวัสดีแชท-gpt3" << std::endl;
  กลับ 0;
 }
